Step 3.2: React Query IntegrationImplement React Query for efficient data fetching, caching, and state management. This provides excellent developer experience with automatic background updates, optimistic updates, and error handling.نسخ// hooks/useTasks.js
import { useQuery, useMutation, useQueryClient } from 'react-query';
import { taskService } from '../services/api';

export const useTasks = (filters = {}) => {
  return useQuery(
    ['tasks', filters],
    () => taskService.getTasks(filters),
    {
      select: (data) => data.data,
      staleTime: 5 * 60 * 1000, // 5 minutes
    }
  );
};

export const useCreateTask = () => {
  const queryClient = useQueryClient();

  return useMutation(taskService.createTask, {
    onSuccess: () => {
      queryClient.invalidateQueries(['tasks']);
    },
  });
};

export const useUpdateTask = () => {
  const queryClient = useQueryClient();

  return useMutation(
    ({ id, data }) => taskService.updateTask(id, data),
    {
      onSuccess: () => {
        queryClient.invalidateQueries(['tasks']);
      },
    }
  );
};
Step 3.3: Authentication ContextCreate an authentication context to manage user state, login/logout functionality, and protected routes throughout the application.نسخ// contexts/AuthContext.jsx
import React, { createContext, useContext, useReducer, useEffect } from 'react';
import { authService } from '../services/api';

const AuthContext = createContext();

const authReducer = (state, action) => {
  switch (action.type) {
    case 'LOGIN_SUCCESS':
      return {
        ...state,
        user: action.payload.user,
        token: action.payload.token,
        isAuthenticated: true,
        loading: false,
      };
    case 'LOGOUT':
      return {
        ...state,
        user: null,
        token: null,
        isAuthenticated: false,
        loading: false,
      };
    case 'SET_LOADING':
      return {
        ...state,
        loading: action.payload,
      };
    default:
      return state;
  }
};

export const AuthProvider = ({ children }) => {
  const [state, dispatch] = useReducer(authReducer, {
    user: null,
    token: localStorage.getItem('auth_token'),
    isAuthenticated: false,
    loading: true,
  });

  useEffect(() => {
    const initializeAuth = async () => {
      const token = localStorage.getItem('auth_token');
      if (token) {
        try {
          const response = await authService.getUser();
          dispatch({
            type: 'LOGIN_SUCCESS',
            payload: {
              user: response.data,
              token,
            },
          });
        } catch (error) {
          localStorage.removeItem('auth_token');
          dispatch({ type: 'LOGOUT' });
        }
      }
      dispatch({ type: 'SET_LOADING', payload: false });
    };

    initializeAuth();
  }, []);

  const login = async (credentials) => {
    try {
      const response = await authService.login(credentials);
      const { user, token } = response.data;

      localStorage.setItem('auth_token', token);
      dispatch({
        type: 'LOGIN_SUCCESS',
        payload: { user, token },
      });

      return { success: true };
    } catch (error) {
      return { success: false, error: error.response?.data?.message };
    }
  };

  const logout = () => {
    localStorage.removeItem('auth_token');
    dispatch({ type: 'LOGOUT' });
  };

  return (
    <AuthContext.Provider value={{ ...state, login, logout }}>
      {children}
    </AuthContext.Provider>
  );
};

export const useAuth = () => {
  const context = useContext(AuthContext);
  if (!context) {
    throw new Error('useAuth must be used within an AuthProvider');
  }
  return context;
};
Database Design and ImplementationPhase 1: Database Schema DesignThe database schema forms the foundation of our task management system, requiring careful consideration of relationships, constraints, and performance optimization. The schema must support complex queries while maintaining data integrity and scalability.Core Entity RelationshipsThe database design centers around five primary entities: Users, Projects, Tasks, Comments, and Attachments. Each entity serves a specific purpose in the task management workflow while maintaining clear relationships with other entities.Users represent the individuals who will interact with the system, whether as administrators, project managers, or team members. The users table includes essential information such as name, email, password hash, role assignments, and profile preferences. Additionally, the table incorporates timestamps for account creation and last activity tracking, which proves valuable for user engagement analytics and security monitoring.Projects serve as containers for related tasks, providing organizational structure and collaborative workspaces. The projects table includes project name, description, status indicators, creation and completion dates, and ownership information. Projects maintain relationships with users through ownership and membership associations, allowing for flexible team assignments and access control.Tasks represent the core work items within the system, containing detailed information about individual assignments. The tasks table includes title, description, priority levels, status indicators, due dates, estimated completion times, and actual completion tracking. Tasks belong to projects and can be assigned to specific users, creating a clear hierarchy and responsibility structure.Comments enable collaborative communication around specific tasks, providing a threaded discussion system that maintains context and history. The comments table includes comment content, author information, timestamps, and parent comment references for nested discussions.Attachments support file sharing and documentation within the context of specific tasks or projects. The attachments table includes file metadata such as original filename, file size, MIME type, storage path, and upload timestamps.Advanced Schema ConsiderationsBeyond the core entities, the schema incorporates several advanced features to support comprehensive task management functionality. These include notification systems, activity logging, and permission management structures.The notifications table tracks system-generated alerts and user communications, including notification type, recipient information, read status, and related entity references. This enables real-time updates and ensures users stay informed about relevant changes and assignments.Activity logs maintain a comprehensive audit trail of all system interactions, recording user actions, entity modifications, and system events. This information proves invaluable for troubleshooting, compliance requirements, and user behavior analysis.Permission management utilizes a role-based access control system with separate tables for roles, permissions, and their associations. This flexible approach allows for granular access control while maintaining simplicity in common use cases.Phase 2: Migration ImplementationLaravel migrations provide version control for database schema changes, ensuring consistent deployment across different environments. Each migration represents a specific schema modification and can be rolled back if necessary.User Management MigrationsThe user migration extends Laravel's default user table with additional fields required for the task management system. This includes role assignments, profile information, and system preferences.نسخ// database/migrations/create_users_table.php
public function up()
{
